import Arrange from '../Arrange/Arrange';
import ArrangeBtn from '../ArrangeBtn/ArrangeBtn';
import { useState } from 'react';

const Form = () => {
  const [formIsSubmitted, setFormIsSubmited] = useState(false);
    const submitForm = () => {
        setFormIsSubmited(true);
    };
  return (
    <div>

            {!formIsSubmitted ? <Arrange submitForm={submitForm}/> : <ArrangeBtn />}

        {/* <Arrange /> */}
    </div>
  )
}

export default Form;
